fun main(main_p1: Array<String>) {
    val main_v1 = (1..3).map {readLine()}
    val main_v2 = main_v1.first()?.toInt()
    val main_v3 = main_v1.elementAt(1)?.toInt()
    val main_v4 = main_v1.last()?.toInt()
    val main_v5 = if(main_v3 != null && main_v4 != null) main_v3*main_v4 else 0
    val main_v6 = if(main_v2 != null && main_v4 != null) main_v2*main_v4 + main_v5/100 else 0
    val main_v7 = main_v5.rem(100)
    print("$main_v6 $main_v7")
}

